import ListItemText from '@material-ui/core/ListItemText';
import Typography from '@material-ui/core/Typography';

const Chat = () => {
  return(
    <ListItem>
    <ListItemAvatar>
      <Avatar alt="icon" src="/static/images/avatar/1.jpg" />
    </ListItemAvatar>
    <div className="p-chat__bubble">ダミーテキスト</div>
  </ListItem>
  )

}

export default Chat
